import { Button } from "@/components/ui/button";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import { 
    FlashcardQuestion,
    FlashcardAnswer, 
} from "@/components/Flashcards/FlashcardViewer";
import { useState, useRef, useEffect } from "react";
import NavigationButtons from "@/components/Flashcards/NavigationButtons";



export default function LandingPage() {
    const [idx, setIdx] = useState(0);
    const [enterFromRight, setEnterFromRight] = useState(true);

    const flashcardSectionRef = useRef<HTMLDivElement | null>(null);
    const scrollToFlashcards = () => {
        flashcardSectionRef.current?.scrollIntoView({behavior: "smooth"});
    }
    return (
        <div className="bg-gray-200">
            <div className="h-screen flex flex-col md:flex-row items-center justify-center">  

                <div className="flex  justify-center items-center flex-col">
                    <div className="text-5xl">
                        Master Anything.
                    </div>
                    <div className="text-4xl text-gray-500">
                        One Flashcard at a Time.
                    </div>
                    <div className="m-5">
                        <Button className="mr-3">
                            <Link to="/signup">
                            Get Started
                            </Link>
                        </Button>
                        <span onClick={scrollToFlashcards} className="cursor-pointer">
                            Learn more <i className="bi bi-arrow-down"></i>
                        </span>
                    </div>
                </div>

                <ScholarlyLandingPageImage />

            </div>

            <div 
                ref={flashcardSectionRef}
                className="h-screen flex flex-col items-center justify-center">
                <LandingPageFlashcardViewer 
                    enterFromRight={enterFromRight} 
                    idx={idx} />
                <NavigationButtons 
                    currIdx={idx}
                    maxIdx={4} 
                    setCardIdx={setIdx} 
                    setEnterFromRightAnimation={setEnterFromRight} 
                    className=""/>
            </div>

        </div>
        
    );
}

interface LandingPageFlashcardViewerProps {
    enterFromRight: boolean,
    idx: number
}
//Step 1: Show one Flashcard in the landing page
function LandingPageFlashcardViewer({enterFromRight, idx}: LandingPageFlashcardViewerProps) {
    const questions = [
        "Why use Flashcards for Studying?",
        "What is Scholarly?", 
        "Why use Scholarly?", 
        "Is Scholarly Paid?", 
        "What if I find a bug?"
    ];

    const answers = [
        <>
            Flashcards are <a 
            href="https://pmc.ncbi.nlm.nih.gov/articles/PMC8368120/" 
            target="_blank"
            rel="noopener noreferrer"
            className="text-blue-500 underline"
            >
                research backed
            </a>{" "} 
            to improve your long term memory.
        </>,
        <>
            Scholarly is a simple and efficient open source Flashcard software. It gives users a smooth experience and it allows them to <a
            href="https://github.com/aryamanpandu/Scholarly/blob/main/README.md"
            target="_blank"
            rel="noopener noreferrer"
            className="text-blue-500 underline">
                self host
            </a>{" "} 
            the application using docker!
        </>,
        "Scholarly improves organization of flashcards by dividing them into topics, then decks. We are also working on bringing an AI feature to create flashcards by using the OpenAI API!",
        <>
            Nope! Scholarly is a personal project by <a
            href="https://www.linkedin.com/in/aryaman-pandey-8a5711247/"
            target="_blank"
            rel="noopener noreferrer"
            className="text-blue-500 underline">
                me
            </a>{" "} so that students can have a great study experience!
        </>,
        <>
            When you find a bug, please create an issue on the <a
            href="https://github.com/aryamanpandu/Scholarly/issues"
            target="_blank"
            rel="noopener noreferrer"
            className="text-blue-500 underline"
            >Scholarly Github
            </a> {" "} 
            with a description and a screenshot of the bug if possible.
        </>
    ];

    
    const [showAnswer, setShowAnswer] = useState(false);

    useEffect(() => {
        setShowAnswer(false);
    }, [idx]);

    return (
        <div className="w-full max-w-xl m-5">

                <motion.div 
                    key={idx}
                    style={{perspective: 1000}}
                    initial={{x: enterFromRight ? "100vw": "-100vw"}}
                    animate={{x: "0"}}
                    exit={{x: enterFromRight ? "-100vw": "100vw"}}
                    transition={{
                        type: "spring",
                        stiffness: 200,
                        damping: 20,
                        duration: 0.2,
                    }}
                >

                    <motion.div
                        animate={{rotateY: showAnswer ? -180: 0}}
                        transition={{duration: 0.3}}
                        className="relative w-full aspect-[5/3] cursor-pointer"
                        style={{
                            transformStyle: "preserve-3d",
                            margin: "20"
                        }}
                        onClick={() => setShowAnswer(prev => !prev)}
                    >
                        <FlashcardQuestion className="absolute" question={questions[idx]}/>

                        <FlashcardAnswer className="absolute" answer={answers[idx]}/>

                    </motion.div>
                </motion.div>

        </div>
    );
}

